import './App.css';
import React from 'react';
import Hello from './Hello';

const App = () => {
  const person1 = {
    name: 'Catherine Reed',
    job: 'Journalist',
    imageSrc: require('./locale.jpg'),
    greeting: 'Greetings from Catherine!',
  };

  const person2 = {
    name: 'John Doe',
    job: 'Developer',
    imageSrc: require('./john.jpg'), // Assuming you have an image for John
    greeting: 'Hello from John!',
  };

  return (
    <div>
      <Hello {...person1} />
      <Hello {...person2} />
    </div>
  );
};

export default App;
